import axois from 'axois';
import { all, fork, put, takeLatest, call } from 'redux-saga';
import { ADD_CALENDAR_FAILURE, ADD_CALENDAR_REQUEST, ADD_CALENDAR_SUCCESS } from '../reducers/calendar';

function addCalendarAPI(data){
    return axois.post('/calendar', data);
}

function* addCalendar(action) {
    try {
        const result = yield call(addCalendarAPI, action.data);
        yield put({
            type: ADD_CALENDAR_SUCCESS,
            data: result.data,
        });
    } catch (error) {
        yield put({
            type: ADD_CALENDAR_FAILURE,
            error: error.responce.data,
        });
    }
}

function* watchAddCalendar() {
    yield takeLatest(ADD_CALENDAR_REQUEST, addCalendar);
}

export default function* calendarSaga (){
    yield all([
        fork(watchAddCalendar),
    ]);
}
